The '''Grand Tree''', or '''Ta Quir Priw''' in gnomish language, is home to a [[gnome]] community and is built inside a tree in the north-east of the [[Tree Gnome Stronghold]]. It contains [[Blurberry]]'s Bar, [[Heckel Funch]]'s Shop, [[Rometti]]'s [[Rometti's Fine Fashions|Fine Fashions]], and [[Gulluck]]'s [[Gulluck and Sons|weapon shop]].

The Grand Tree includes two of the three [[bank]]s in [[Tree Gnome Stronghold]], several shops, and a bar and restaurant. The [[Gnome Restaurant]] minigame is on second level, and players who have completed [[The Grand Tree]] quest can access the [[Grand Tree Mine]]. There is an [[Agility]] shortcut north-east of the Grand Tree, which can be very useful for players training [[barbarian fishing]].

==Transportation==
Players can travel to the Grand Tree via the [[gnome glider]] on the {{FloorNumber|uk=3}}, or they can use [[seed pod]]s from the [[Gnome Restaurant]] minigame to transport instantly to the Grand Tree. You may also use the [[royal seed pod]] after completion of Monkey Madness II. Just south of the tree itself is a [[Spirit Tree]], and a landing spot for the [[Balloon Transport System]]. For those who don't have access to gnome glider or seed pods, you can also teleport to the [[Outpost]] using a [[necklace of passage]] and head north.

==Ground floor==
Players can find [[King Narnode Shareen]] on the {{FloorNumber|uk=0}}. Players can speak to him to begin (and later end) the [[Monkey Madness I]] quest. There is also a trapdoor that leads to the [[Grand Tree Tunnels]] (and [[Grand Tree mine|a mine]]), though players must have completed [[The Grand Tree]] in order to use it.

