==Third floor==
The {{FloorNumber|uk=3}} contains only a small jail that [[Glough]] locks the player in during [[The Grand Tree]] quest, and a [[Gnome glider]] which can be used to travel to various places in [[Gielinor]].

==Tunnels and mine==
Most of the tunnels are little used except during [[The Grand Tree]] quest. See [[Grand Tree Tunnels]] for details.

The mine contains [[Adamantite ore|adamantite]], [[Mithril ore|mithril]], [[Gold ore|gold]], [[coal]], [[Silver ore|silver]], [[Iron ore|iron]], and [[clay]] rocks. See [[Grand Tree Mine]] for details.

